heat_template_version: pike

resources:

  security_group_allallow:
    type: OS::Neutron::SecurityGroup
    properties:
      name: AllAllow
      rules:
        - direction: ingress
          ethertype: IPv4
          remote_ip_prefix: 0.0.0.0/0
          protocol: tcp
        - direction: ingress
          ethertype: IPv4
          remote_ip_prefix: 0.0.0.0/0
          protocol: udp
        - direction: ingress
          ethertype: IPv4
          remote_ip_prefix: 0.0.0.0/0
          protocol: icmp

  monitor_network:
    type: OS::Neutron::Net
    properties:
      name: monitor
  monitor_subnet:
    type: OS::Neutron::Subnet
    properties:
      name: monitor
      network_id: { get_resource: monitor_network }
      ip_version: 4
      cidr: 172.16.0.0/16
  monitor_port:
    type: OS::Neutron::Port
    properties:
      name: monitor
      network: { get_resource: monitor_network }
      fixed_ips:
        - subnet: { get_resource: monitor_subnet }
          ip_address: 172.16.0.254
      security_groups:
        - { get_resource: security_group_allallow}

